import React from 'react';


function Body() {
  return (
    <body className="modal-fullscreen ">


      <p>Url Shortener</p>
      <button onclick="window.location.href='/user/signup'" class="signupbtn" >Signup</button>
<ul>
<button onclick="window.location.href='/user/login'" class="loginbtn" >Login</button>
<button onclick="window.location.href='/home/view'">List Of URL's Shortened</button><br></br>
</ul>
    </body>
  );
}

export default Body;
